<!doctype html>
<html lang="en">
<head>
<meta charset="utf-8" />
<meta name="viewport" content="width=device-width, initial-scale=1" />
<title>Annual Pension Calculator</title>
<style>
  :root {
    --years: #af674b;
    --mult: #78be20;
    --salary: #8c1d40;
    --result: #ff7f32;
  }
  body {
    margin: 0;
    min-height: 100vh;
    display: grid;
    place-items: center;
    background: #ffffff;
    font-family: system-ui, -apple-system, Segoe UI, Roboto, Helvetica, Arial, sans-serif;
  }
  .stage {
    position: relative;
    width: min(960px, 100vw);
    aspect-ratio: 960 / 540;
  }
  .stage img {
    position: absolute;
    inset: 0;
    width: 100%;
    height: 100%;
    user-select: none;
    pointer-events: none;
  }
  .overlay-input {
    position: absolute;
    box-sizing: border-box;
    border: 1px solid #d9d9d9;
    border-radius: 8px;
    padding: 0 14px;
    font-size: clamp(12px, 1.6vw, 16px);
    height: 7.222%;
    display: flex;
    align-items: center;
  }
  .overlay-input input {
    width: 100%;
    height: 100%;
    border: 0;
    background: transparent;
    font: inherit;
    color: #333;
    outline: none;
  }
  .suffix-wrapper {
    position: relative;
    width: 100%;
    height: 100%;
    display: flex;
    align-items: center;
  }
  .suffix-wrapper input {
    padding-right: 20px;
  }
  .suffix {
    position: absolute;
    right: 6px;
    font-size: 0.9em;
    opacity: 0.7;
    pointer-events: none;
  }
  .tint-years { background: color-mix(in srgb, var(--years) 18%, white); }
  .tint-mult  { background: color-mix(in srgb, var(--mult) 18%, white); }
  .tint-sal   { background: color-mix(in srgb, var(--salary) 18%, white); }
  .tint-res   { background: color-mix(in srgb, var(--result) 22%, white); border-color: #ffd3bd; }
</style>
</head>

    <div class="overlay-input tint-years" style="left: 28.125%; top: 69.074%; width: 11.667%;">
      <input id="years" type="number" min="0" step="1" value="25" />
    </div>

    <div class="overlay-input tint-mult" style="left: 45.208%; top: 69.074%; width: 11.667%;">
      <div class="suffix-wrapper">
        <input id="mult" type="number" min="0" step="0.01" value="2" />
        <span class="suffix">%</span>
      </div>
    </div>

    <div class="overlay-input tint-sal" style="left: 62.292%; top: 69.074%; width: 11.667%;">
      <input id="salary" type="number" min="0" step="100" value="75000" />
    </div>

    <div class="overlay-input tint-res" style="left: 28.125%; top: 84.444%; width: 45.729%;">
      <input id="result" type="text" readonly />
    </div>
  </div>

<script>
  const yearsEl  = document.getElementById('years');
  const multEl   = document.getElementById('mult');
  const salaryEl = document.getElementById('salary');
  const resEl    = document.getElementById('result');

  function toNumber(v) {
    const n = Number(v);
    return Number.isFinite(n) ? n : 0;
  }

  function formatMoney(n) {
    return n.toLocaleString(undefined, { maximumFractionDigits: 0 });
  }

  function calc() {
    const years = toNumber(yearsEl.value);
    const salary = toNumber(salaryEl.value);
    let mult = toNumber(multEl.value);

    if (mult > 1) mult = mult / 100;

    const annualPension = years * mult * salary;
    resEl.value = formatMoney(annualPension);
  }

  ['input','change'].forEach(evt => {
    yearsEl.addEventListener(evt, calc);
    multEl.addEventListener(evt, calc);
    salaryEl.addEventListener(evt, calc);
  });

  calc();
</script>
</body>
